import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';

// Import components from folders
import HomeScreen from './components/home.js';
import GuestListList from './components/guestlist.js';
import CreateGuest from './components/createguest.js';
import VendorScreen from './components/vendor.js';
import BridalDressList from './components/bridaldress.js';
import CatererList from './components/caterer.js';
import MakeupList from './components/makeup.js';
import PhotographerList from './components/photographer.js';
import VenueList from './components/venue.js';

const Stack = createStackNavigator();
const Tab = createBottomTabNavigator();

function HomeStackScreens() {
  return (
    <Stack.Navigator>
      <Stack.Screen
        name="Home"
        component={HomeScreen}
        options={{
          headerStyle:
          {
            backgroundColor: "#980007",
          },
          headerTintColor: '#fff',
        }}
      />
    </Stack.Navigator>
  )
}

function VendorStackScreens() {
  return (
    <Stack.Navigator>
      <Stack.Screen
        name="Vendor"
        component={VendorScreen}
        options={{
          headerStyle: {
            backgroundColor: "#980007",
          },
          headerTintColor: '#fff',
        }}
      />
      <Stack.Screen
        name="BridalDress"
        component={BridalDressList}
        options={{
          headerStyle: {
            backgroundColor: "#980007",
          },
          headerTintColor: '#fff',
        }}
      />
      <Stack.Screen
        name="Caterer"
        component={CatererList}
        options={{
          headerStyle: {
            backgroundColor: "#980007",
          },
          headerTintColor: '#fff',
        }}
      />
      <Stack.Screen
        name="Makeup"
        component={MakeupList}
        options={{
          headerStyle: {
            backgroundColor: "#980007",
          },
          headerTintColor: '#fff',
        }}
      />
      <Stack.Screen
        name="Photographer"
        component={PhotographerList}
        options={{
          headerStyle: {
            backgroundColor: "#980007",
          },
          headerTintColor: '#fff',
        }}
      />
      <Stack.Screen
        name="Venue"
        component={VenueList}
        options={{
          headerStyle: {
            backgroundColor: "#980007",
          },
          headerTintColor: '#fff',
        }}
      />
    </Stack.Navigator>
  )
}

function GuestListStackScreens() {
  return (
    <Stack.Navigator>
      <Stack.Screen
        name="GuestList"
        component={GuestListList}
        options={{
          headerStyle: 
          {
            backgroundColor: "#980007",
          },
          headerTintColor: '#fff',
        }}
      />
      <RootStack.Screen
        name="CreateGuest"
        component={CreateGuest}
        options={{
          headerStyle: 
          {
            backgroundColor: "#980007",
          },
          headerTintColor: '#fff',
        }}
      />
    </Stack.Navigator>
  )
}

